import "./LoginCard.css";

const LoginCard = () =>{
    return(
        <div className="box">
            <form>
            <label>
                Name:
                <input type="text" name="name" />
            </label>
            <input type="submit" value="Submit" />
            </form>
        </div>
    )
}

export default LoginCard;
